import React, { useState } from "react";
import "./Signup.css";
import { sendRequest } from "../../utils/sendRequest";

function Mignup() {
  const [suteItem, setSureItem] = useState();
  const [suteItem2, setSureItem2] = useState();
  const [suteItem3, setSureItem3] = useState();
  const [suteItem4, setSureItem4] = useState();

  const monister = () => {
    console.log(suteItem, suteItem2, suteItem3, suteItem4);
  };

  return (
    <div>
      <div className="loginPage">
        <div className="organize">
          <p className="loginString">signUp</p>
        </div>
        <div className="inputLogin">
          <input
            type="email"
            className="firstInput"
            placeholder="firstName"
            onChange={(e) => setSureItem(e.target.value)}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="secondeName"
            onChange={(e) => setSureItem2(e.target.value)}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="email"
            onChange={(e) => setSureItem3(e.target.value)}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="enterYourPassword"
            onChange={(e) => setSureItem4(e.target.value)}
          />
        </div>

        <div className="enterToLogIin">
          <h1
            className="enterToLogIinString"
            onClick={() => {
              sendRequest(
                "signup",
                {
                  name: suteItem,
                  secondName: suteItem2,
                  email: suteItem3,
                  password: suteItem4,
                },
                "POST"
              );
            }}
            onClick={() => monister()}
          >
            sign in
          </h1>
          <a className="signInString">log in </a>
        </div>
      </div>
    </div>
  );
}

export default Mignup;
